//         itemimg: '',
//         itemInfo: '[진기의 철의왕좌]',
//         category: '상품문의',
//         title: '앉아도 찔리진 않을까요?',
//         qnapost: '어성은 내용샘플',
//         titleIcon: '[1]',
//         writer: '어성은',

